def make_palindrome(string: str) -> str:
    """ Find the shortest palindrome that begins with a supplied string.
    Algorithm idea is simple:
    - Find the longest postfix of supplied string that is a palindrome.
    - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
    >>> make_palindrome('')
    ''
    >>> make_palindrome('cat')
    'catac'
    >>> make_palindrome('cata')
    'catac'
    """
    def find_palindrome_suffix(s: str) -> str:
        for i in range(len(s)):
            if is_palindrome(s[i:]):
                return s[i:]
        return ''

    def find_prefix(s: str) -> str:
        for i in range(len(s)):
            if is_palindrome(s[:i]):
                return s[:i]
        return ''

    palindrome_suffix = find_palindrome_suffix(string)
    prefix = find_prefix(string)

    if palindrome_suffix:
        return string[:len(prefix)] + palindrome_suffix + palindrome_suffix[::-1]
    else:
        return string

